<p class="Section amending"><strong><a class="sectionLabel" id="s-88"><span class="sectionLabel">88</span></a></strong> La Dénomination des marchandises du numéro tarifaire 2202.99.33 de la liste des dispositions tarifaires dans la version française de l’annexe de la même loi est modifiée par remplacement des termes « non conditionnés » par « non conditionnées ».</p>
